import React, { Component } from "react";
// import Footer from "./components/Footer";
// import Header from "./components/Header";
// import MainContent from "./components/MainContent";
// import { render } from "react-dom";

//JSX, functionnal Component, always name as camel case 

class App extends Component {
    //lifecycle method
    render(){
		//Only return single JSX element, has to have one parent element
		//can wrapping everything in a div
        return (
            <div className='App'>
                <h1>hi</h1>
            </div>
        );
    }
}

export default App;
